function Props() {
	function Componentito( props ) {
		return <button style={{ padding: "0 60px" , width: "auto" , backgroundColor: "red" , color: "white" , margin: "0 auto" , textAlign: "center" }}>{props.texto}</button>
	}
	return(
		<section id="componentest">
			<h1>ComponenTEST</h1>
			<div style={{ display: flex }}>
				<input placeholder="uffff" />
				<button>CAMBIAR COMPONENTE</button>
			</div>
			<Componentito texto="HEHE 1" />
		</section>
	)
}

export default Props;
